import React from "react";

import { Form, Col } from "react-bootstrap";
import Button from "../../../../../../components/Button";
import { StyledButtonGroup } from "./styled-components";
import { FormattedMessage } from "react-intl";
import Input from "../../../../../../components/Input";

const EditUserForm = ({
  values,
  handleChange,
  handleBlur,
  handleSubmit,
  onClose,
  errors
}) => {
  return (
    <Form onSubmit={handleSubmit}>
      <Form.Row>
        <Form.Group as={Col} >
          {/* <Form.Label>
            <FormattedMessage id={"userTable.name"} />
          </Form.Label> */}
          <Input
            type="text"
            name="name"
            id="name"
            label="userTable.name"
            value={values.name}
            onChange={handleChange}
          />
        </Form.Group>
        <Form.Group as={Col} >
          {/* <Form.Label>
            <FormattedMessage id={"userTable.surname"} />
          </Form.Label> */}
          <Input
            type="text"
            placeholder="Surname"
            name="surname"
            id="surname"
            value={values.surname}
            onChange={handleChange}
          />
        </Form.Group>
        <Form.Group as={Col} >
          {/* <Form.Label>
            <FormattedMessage id={"userTable.address"} />
          </Form.Label> */}
          <Input
            // type="text"
            // placeholder="Address"
            // name="address"
            // id="address"
            // value={values.address}
            // onChange={handleChange}
            name={"address"}
            label="userTable.address"
            handleChange={handleChange}
            type="text"
            value={values.address}
            errors={errors.address}
          />
        </Form.Group>
        <Form.Group as={Col} >
          {/* <Form.Label>
            <FormattedMessage id={"userTable.email"} />
          </Form.Label> */}
          <Input
            type="email"
            placeholder="Enter email"
            name="email"
            id="email"
            value={values.email}
            onChange={handleChange}
          />
        </Form.Group>
        <Form.Group as={Col} >
          {/* <Form.Label>
            <FormattedMessage id={"userTable.dni"} />
          </Form.Label> */}
          <Input
            placeholder="Dni"
            type="text"
            name="dni"
            id="dni"
            value={values.dni}
            onChange={handleChange}
          />
        </Form.Group>
      </Form.Row>
      <StyledButtonGroup>
        <Button
          onClick={()=> onClose({ type: "hide" })}
          type="text"
          label="button.cancel"
          variant="cancel"
        />
        <Button type="submit" label="button.confirm" variant="confirm" />
      </StyledButtonGroup>
    </Form>
  );
};

export default EditUserForm;
